contracts/Athl3te.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./CommunityRoom.sol";

contract Athl3te {
    struct Activity {
        string activityDetails;
    }

    struct User {
        bool isRegistered;
        uint age;
        string gender;
        string name;
        uint weight;
        uint height;
        Activity[] activities;
    }

    mapping(address => User) private users;
    address[] public deployedCommunityRooms;

    event CommunityRoomCreated(address indexed roomAddress, address indexed createdBy);
    event ActivityAdded(address indexed user, string activityDetails);
    event UserRegistered(address indexed user, string name);

    function registerUser(string memory _name, uint256 _age, string memory _gender, uint256 _weight, uint256 _height) public {
        require(!users[msg.sender].isRegistered, "User already registered!");
        require(_age > 0, "Age must be greater than zero!");
        require(_weight > 0, "Weight must be greater than zero!");
        require(_height > 0, "Height must be greater than zero!");
        require(bytes(_name).length > 0, "Name cannot be empty!");
        require(bytes(_gender).length > 0, "Gender cannot be empty!");

        User storage newUser = users[msg.sender];
        newUser.isRegistered = true;
        newUser.age = _age;
        newUser.gender = _gender;
        newUser.name = _name;
        newUser.weight = _weight;
        newUser.height = _height;

        emit UserRegistered(msg.sender, _name);
    }

    function addActivity(string memory _activityDetails) public {
        require(users[msg.sender].isRegistered, "User not registered!");
        require(bytes(_activityDetails).length > 0, "Activity details cannot be empty!");

        users[msg.sender].activities.push(Activity(_activityDetails));
        emit ActivityAdded(msg.sender, _activityDetails);
    }

    function getUserDetails() public view returns (string memory, uint, string memory, uint, uint, string[] memory) {
        require(users[msg.sender].isRegistered, "User not registered!");

        User storage user = users[msg.sender];
        uint activityCount = user.activities.length;
        string[] memory activities = new string[](activityCount);

        for (uint i = 0; i < activityCount; i++) {
            activities[i] = user.activities[i].activityDetails;
        }

        return (user.name, user.age, user.gender, user.weight, user.height, activities);
    }

    function getUsername() public view returns (string memory) {
        require(users[msg.sender].isRegistered, "User not registered!");
        return users[msg.sender].name;
    }

    function getUserActivityCount() public view returns (uint) {
        require(users[msg.sender].isRegistered, "User not registered!");
        return users[msg.sender].activities.length;
    }

    function createCommunityRoom(string memory communityName, string memory communityLogo, string memory systemPrompt, uint256 assistantUnlockCost) public {
        require(bytes(communityName).length > 0, "Community name cannot be empty!");
        require(bytes(communityLogo).length > 0, "Community logo cannot be empty!");
        require(bytes(systemPrompt).length > 0, "System prompt cannot be empty!");

        CommunityRoom newRoom = new CommunityRoom(msg.sender, communityName, communityLogo, systemPrompt, assistantUnlockCost);
        deployedCommunityRooms.push(address(newRoom));

        emit CommunityRoomCreated(address(newRoom), msg.sender);
    }

    function getDeployedCommunityRooms() public view returns (address[] memory) {
        return deployedCommunityRooms;
    }
}

contracts/CommunityRoom.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./PersonalAssistant.sol";

contract CommunityRoom {

    struct Message {
        string text;
        address userAddress;
        string ipfsImageUrl;
        uint256 timestamp;
    }

    address public createdBy;
    mapping(address => bool) private members;
    mapping(address => bool) private membersWithPersonalAssistants;
    uint256 public assistantUnlockCostInEth;

    Message[] private messages;

    string public communityName;
    string public communityLogo;
    string public systemPrompt;

    address[] private deployedPersonalAssistants;

    event MessageSent(address indexed user, string text, string ipfsImageUrl, uint256 timestamp);
    event MemberJoined(address indexed user);
    event MemberLeft(address indexed user);

    event PersonalAssistantUnlocked(address indexed user, address indexed assistantAddress);

    modifier onlyMembers() {
        require(members[msg.sender], "Only members can send messages");
        _;
    }

    constructor(address _creator, string memory _communityName, string memory _communityLogo, string memory _systemPrompt, uint256 _assistantUnlockCost) {
        createdBy = _creator;
        communityName = _communityName;
        communityLogo = _communityLogo;
        systemPrompt = _systemPrompt;
        members[_creator] = true; 
        assistantUnlockCostInEth = _assistantUnlockCost;
    }

    function joinCommunity() public {
        require(!members[msg.sender], "User is already a member");
        members[msg.sender] = true;
        emit MemberJoined(msg.sender);
    }

    function leaveCommunity() public {
        require(members[msg.sender], "User is not a member");
        members[msg.sender] = false;
        emit MemberLeft(msg.sender);
    }

    function userSendMessage(string memory _text, string memory _ipfsImageUrl) public onlyMembers {
        messages.push(Message(_text, msg.sender, _ipfsImageUrl, block.timestamp));
        emit MessageSent(msg.sender, _text, _ipfsImageUrl, block.timestamp);
    }

    function aiSendMessage(string memory _text, string memory _ipfsImageUrl) public {
        messages.push(Message(_text, address(0), _ipfsImageUrl, block.timestamp));
        emit MessageSent(address(0), _text, _ipfsImageUrl, block.timestamp);
    }

    function getMessages() public view returns (Message[] memory) {
        return messages;
    }

    function getMemberStatus(address _user) public view returns (bool) {
        return members[_user];
    }

    function unlockPersonalAssistant() public payable {
        require(!members[msg.sender], "User is not a member of the community.");
        require(!membersWithPersonalAssistants[msg.sender], "User already has a personal assistant.");
        require(msg.value == assistantUnlockCostInEth, "Incorrect payment amount.");


        // amount received would u sent over to the creator of the community room
        payable(createdBy).transfer(msg.value);

        PersonalAssistant newAssistant = new PersonalAssistant(msg.sender, systemPrompt, communityName, communityLogo);    
        deployedPersonalAssistants.push(address(newAssistant));
        membersWithPersonalAssistants[msg.sender] = true;

        emit PersonalAssistantUnlocked(msg.sender, address(newAssistant));
    }

    function getDeployedPersonalAssistants() public view returns (address[] memory) {
        return deployedPersonalAssistants;
    }
}

contracts/PersonalAssistant.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PersonalAssistant {
    struct Message {
        string text;
        address userAddress; //set address(0) for AI responses
        string ipfsImageUrl;
        uint256 timestamp;
    }

    address public owner;
    string public communityName;
    string public communityLogo;
    string private systemPrompt;
    Message[] private messages;

    event MessageSent(address indexed user, string text, string ipfsImageUrl, uint256 timestamp);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can interact with the assistant.");
        _;
    }

    constructor(address _owner, string memory _systemPrompt, string memory _communityName, string memory _communityLogo) {
        owner = _owner;
        systemPrompt = _systemPrompt;
        communityName = _communityName;
        communityLogo = _communityLogo;
    }

    function sendMessage(string memory _text, string memory _imageUrl) public onlyOwner {
        Message memory newMessage = Message(_text, msg.sender, _imageUrl, block.timestamp);
        messages.push(newMessage);
        emit MessageSent(msg.sender, _text, _imageUrl, block.timestamp);
    }

    function aiSendMessage(string memory _text, string memory _imageUrl) public onlyOwner {
        Message memory newMessage = Message(_text, address(0), _imageUrl, block.timestamp);
        messages.push(newMessage);
        emit MessageSent(address(0), _text, _imageUrl, block.timestamp);
    }

    function getMessages() public view onlyOwner returns (Message[] memory) {
        return messages;
    }
}

